static gboolean
sns_adaptor_service_processor_dispatch_call (ThriftDispatchProcessor *dispatch_processor,
                                             ThriftProtocol *input_protocol,
                                             ThriftProtocol *output_protocol,
                                             gchar *method_name,
                                             gint32 sequence_id,
                                             GError **error)
{
  sns_adaptor_service_processor_process_function_def *process_function_def;
  gboolean dispatch_result = FALSE;

  SnsAdaptorServiceProcessor *self = SNS_ADAPTOR_SERVICE_PROCESSOR (dispatch_processor);
  ThriftDispatchProcessorClass *parent_class =
    g_type_class_peek_parent (SNS_ADAPTOR_SERVICE_PROCESSOR_GET_CLASS (self));

  process_function_def = g_hash_table_lookup (self->process_map, method_name);
  if (process_function_def != NULL)
  {
    g_free (method_name);
    dispatch_result = (*process_function_def->function) (self,
                                                         sequence_id,
                                                         input_protocol,
                                                         output_protocol,
                                                         error);
  }
  else
  {
    dispatch_result = parent_class->dispatch_call (dispatch_processor,
                                                   input_protocol,
                                                   output_protocol,
                                                   method_name,
                                                   sequence_id,
                                                   error);
  }

  return dispatch_result;
}

static void
sns_adaptor_service_processor_set_property (GObject *object,
                                            guint property_id,
                                            const GValue *value,
                                            GParamSpec *pspec)
{
  SnsAdaptorServiceProcessor *self = SNS_ADAPTOR_SERVICE_PROCESSOR (object);

  switch (property_id)
  {
    case PROP_SNS_ADAPTOR_SERVICE_PROCESSOR_HANDLER:
      if (self->handler != NULL)
        g_object_unref (self->handler);
      self->handler = g_value_get_object (value);
      g_object_ref (self->handler);
      break;
    default:
      G_OBJECT_WARN_INVALID_PROPERTY_ID (object, property_id, pspec);
      break;
  }
}

